  return (
    <div className='App-container'>
      <>
        <PortfolioCard backgroundColor='#08028C' color1='#D74505' color2='#D74505' color3='#D74505'></PortfolioCard>
        <PortfolioCard backgroundColor='#08028C' color1='#D74505' color2='#D74505' color3='#D74505'></PortfolioCard>
      </>
